INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 401, 2, 10046, 24001, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "アヤネ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 402, 2, 10046, 24002, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 0.0, "2030/12/17 14:59:59", 2.21, 24, "アヤネ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 403, 2, 10046, 24003, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "アヤネ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 701, 1, 10046, 24004, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 0.0, "2030/12/17 14:59:59", 1.99, 24, "アサヒ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 702, 2, 10046, 24005, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 0.0, "2030/12/17 14:59:59", 2.21, 24, "アサヒ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 703, 1, 10046, 24006, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 0.0, "2030/12/17 14:59:59", 3.33, 24, "アサヒ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 801, 2, 10046, 24007, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "部員３", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 802, 2, 10046, 24008, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 0.0, "2030/12/17 14:59:59", 2.68, 24, "部員３", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 803, 2, 10046, 24009, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "部員３", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 501, 1, 10046, 24010, 192501, "やった！", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 502, 1, 10046, 24011, 192501, "勝ったよ！", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 503, 1, 10046, 24012, 192501, "いい調子！", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (6, 111, 2, 10046, 24013, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 0.0, "2030/12/17 14:59:59", 5.33, 24, "ミサト", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 112, 2, 10046, 24014, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 0.0, "2030/12/17 14:59:59", 6.85, 24, "ミサト", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 113, 2, 10046, 24015, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 0.0, "2030/12/17 14:59:59", 3.0, 24, "ミサト", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 611, 2, 10046, 24016, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 0.0, "2030/12/17 14:59:59", 6.11, 24, "ダイチ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 612, 2, 10046, 24017, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 0.0, "2030/12/17 14:59:59", 6.75, 24, "ダイチ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 613, 2, 10046, 24018, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "ダイチ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 211, 1, 10046, 24019, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 0.0, "2030/12/17 14:59:59", 4.52, 24, "ハツネ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 212, 1, 10046, 24020, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 0.0, "2030/12/17 14:59:59", 3.89, 24, "ハツネ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 213, 2, 10046, 24021, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 0.0, "2030/12/17 14:59:59", 13.49, 24, "ハツネ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 311, 2, 10046, 24022, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 0.0, "2030/12/17 14:59:59", 3.17, 24, "カヤ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 312, 2, 10046, 24023, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 0.0, "2030/12/17 14:59:59", 4.42, 24, "カヤ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (6, 313, 1, 10046, 24024, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 0.0, "2030/12/17 14:59:59", 2.89, 24, "カヤ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (4, 421, 3, 10046, 24025, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 0.0, "2030/12/17 14:59:59", 3.71, 24, "アヤネ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 721, 1, 10046, 24026, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 0.0, "2030/12/17 14:59:59", 5.1, 24, "アサヒ", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 821, 3, 10046, 24027, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 0.0, "2030/12/17 14:59:59", 4.34, 24, "部員３", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 521, 1, 10046, 24028, 192501, "いい勝負だったよ\nまたやろうね", 0.0, 0.0, "2030/12/17 14:59:59", 0.0, 24, "", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 101, 2, 10046, 24029, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, -360.0, "2030/12/17 14:59:59", 5.62, 24, "ミサト", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 102, 2, 10046, 24030, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, -360.0, "2030/12/17 14:59:59", 9.58, 24, "ミサト", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 103, 2, 10046, 24031, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, -360.0, "2030/12/17 14:59:59", 0.0, 24, "ミサト", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (2, 104, 1, 10046, 24032, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, -360.0, "2030/12/17 14:59:59", 9.13, 24, "ミサト", "2020/07/31 12:00:00");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (1, 105, 2, 10046, 24033, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, -360.0, "2030/12/17 14:59:59", 8.27, 24, "ミサト", "2020/07/31 12:00:00");
